import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Navbar from "./Navbar";
import Book from ""

function createCard(contact) {
    return (
        <Book
            key={contact.id}
            name={contact.name}
            img={contact.imgURL}
            tel={contact.phone}
            email={contact.email}
        />
    );
}


function App() {
    return (
        <div className="App">
            <Header />
            <Navbar />

            <Footer />
        </div>
    );
}

export default App;
